import api from '../api';


export default async function saveGarden(id, plants){
  let savedGarden = []
  for (let plant = 0; plant < plants.length; plant ++) {
    console.log("Plant info")
    console.log(plants.length)
    console.log(plant)
    const parsedPlant = plants[plant]
    const savedPlant = {date: savedPlant.date, position: savedPlant.position}
    savedGarden.push(savedPlant.props)
  }
  console.log("SavedGarden")
  console.log(savedGarden)
  const garden = {"garden" : plants}
  console.log("Attempting to save garden")
  console.log(garden)
  console.log(id)
  await api.updateGarden(id, garden).then(res => {
        console.log('Garden updated successfully')
        console.log(plants.length)
    })
}
